import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: '123'
        },
        {
          name: 'Frank',
          id: '123a'
        },
        {
          name: 'Jacky',
          id: '123b'
        },
        {
          name: 'Andrei',
          id: '123c'
        }
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster)=>{
           return(
            <div key={monster.id}>
              <h1>{monster.name}</h1>
            </div>
           )
          })
        }
       </div>
    );
  }

}

export default App;
